\copy (select a.vieweduserid, case when b.eventtype = '_Unknown' then 'Unknown' when b.eventtype is null then 'No Event Type' else b.eventtype end as eventtype, count(*) as profile_view_cnt from jt.pve_non_pride_views a join (select applicationid, eventtype, startdate, enddate, users from jt.tm_eventcubesummary) b on a.application_id = cast(b.applicationid as varchar) where a.pvedatetime >= b.startdate and a.pvedatetime <= b.enddate group by 1,2) to '/home/jteruya/pve_investigate/csv/pve_non_pride_view_count.csv' with csv;
